condicoes_gerais.descricao:
O levantamento topográfico, em qualquer uma de suas finalidades, deve compreender as seguintes fases:

A) Planejamento, seleção de métodos, equipes e aparelhagem;
B) Apoio topográfico;
C) Levantamento de detalhes;
D) Cálculos e ajustes;
E) Desenho topográfico final (mídia papel ou em formato eletrônico);
F) Relatório técnico (quando aplicável).
